import React from 'react';
import './App.css';

function App() {

  handleChange = ( e ) => {
    e.target.value
  }

  return (
    <div className="App">
      <div>
        < input placeholder = 'Input Anything' onChange = {handleChange}/>
        <select>
          <option value='success'>Success</option>
          <option value='warning'>Warning</option>
          <option value='error'>Error</option>
        </select>
      </div>
    </div>
  );
}

export default App;
